import React from 'react';
import './About.css';

function About() {
  return (
    <div className="about-container">
      <h1>About ProCompare</h1>
      <p>
        ProCompare is your go-to platform for finding the best deals across
        multiple online retailers. Compare products from Flipkart and Amazon,
        and make informed purchasing decisions with ease.
      </p>
      <p>
        Our mission is to save your time and money by providing a seamless
        comparison experience. Stay tuned for exciting new features and updates!
      </p>
    </div>
  );
}

export default About;
